import axios from "axios";
export const get = async (url) => {
  const response = await axios
    .get(url)
    .then((res) => {
      if(res.status === 200) {
        if(res.data?.success) {
          return res.data?.data;
        }
      } else {
        return null;
      }
      // return res;
    })
    .catch((err) => {
      console.error(err);
    });
  return response;
};

export const remove = async (url, data) => {
  const response = await axios
    .delete(url, data)
    .then((res) => {
      return res;
    })
    .catch((err) => {
      console.error(err);
    });
  return response;
};

